  input: 'TEXT,F3XA,,"The Committee is in receipt of the Commissions Request for Further
    Information dated 12/06/2006.  -  Schedule A of the Committee''s report had two
    contributions in excess of the limits.  $600 has been refunded to Steve Patience
    and $5,000 has been refunded to the Bank of America Corporation Federal PAC. and
