    Expenditures on behalf of the US Senate Candidate exceeded $345,300 due to the
    fact that the Democratic Senatorial Campaign seeded the remainder of its authority
    to the Arizona Democratic Party on 09/07/2006 giving the committee a total spending
    authority of $633,769 a copy of the letter seeding this authority will be delivered
    to the FEC separately.  -  The Committee''s established procedure for obtaining
    Best Efforts is as follows:  1) Original solicitations for fundraising receptions
    or direct mail solicitation for funds include contribution cards that clearly
    request and explain that federal law requires us to request and report the required
    information.  2) At the reception when checks are received, contributors are asked
    to fill out contribution cards if they haven''t already that requests and explains
    that federal law requires us to request and report the required information.  3)
    Arizona fundraising staff then follows up on contributions that are in excess
    of $200 by phone prior to the filing of each monthly report with a list provided
    by the Compliance Department and information obtained is reported on that report.
    4) Finally, every 30 days the Compliance Department sends a letter which includes
    a pre-addressed, stamped return envelope and forms that clearly asks for the missing
    information.  If information is provided after the reporting period and the contributor
    will not appear on the next regularly scheduled report; amendments to the report
    originally disclosing the contribution will be filed  - Partner Share is now reflected
    for the Primary Consultants, LLC   -  Schedule H6 expenditures related to Vote
    By Mail Postage, VMB Return Postage, Telemarketing Consulting Fees, Bulk Reply
    Mail Account, VBM Application Mailing and Early Voting Ballot Request Postcards
    have been clarified and did not promote, support, attack, or oppose any candidate
    for federal office.  Schedule H6 disbursements in question with the purpose of
    VBM Slate Mail Production and Postage are now disclosed as FEA on line 30b due
    to the reference of federal candidates.  No express advocacy and no allocation
    of Levin funds or any non-federal funds were transferred to a federal account
    for these disbursements at any time.  -  Schedule B supporting Line 30b had a
    description for Fundraising Consultant & Expenses that has been clarified.  Expenditures
    described as VBM Slate Card and VBM Slate Mail Production and Postage federal
    candidate portion are reported on Schedule F with the identity of the candidates.  -   All
    payroll and benefits reported on Schedule H4 were for employees who spent 25%
    or less of their time on FEA or activities in connection with a Federal Election.  Please
    note that payroll and benefits for employees that spent more than 25% of their
